import Header from "../components/Header";
import Footer from "../components/Footer";
import FooterMob from "../components/FooterMob";

function Good() {
  return (
    <div className="wrapper">
      <Header cartPrice={2120} />
      <div className="good__main">
        <div className="good__container">
          <div class="tkani__navigation">
            <div class="tkani__navigation__back-btn">Назад</div>
            <ul class="tkani__navigation__chapter-list">
              <li class="tkani__navigation__chapter__item">Каталог</li>
              <li class="tkani__navigation__chapter__item">Спальня</li>
              <li class="tkani__navigation__chapter__item">Постельное белье</li>
              <li class="tkani__navigation__chapter__item">
                Комплект постельного белья
              </li>
            </ul>
          </div>
        </div>
      </div>
      <Footer />
      <FooterMob cartPrice={212000} />
    </div>
  );
}

export default Good;
